import logo from './logo.svg';
import './App.css';
import { Router, Routes, Route } from 'react-router-dom';
import Home from "./pages/index.js";
import About from "./pages/about.js"

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
          <Route path="/" component={Home} />
          <Route path="/about" component={About} />
      </Routes>
</Router>
  );
}

export default App;
